import React from 'react';
import { Link } from 'react-scroll';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="nav-links">
        <Link to="home" smooth={true} duration={500}>Home</Link>
        <Link to="forest" smooth={true} duration={500}>Forest</Link>
        <Link to="beach" smooth={true} duration={500}>Beach</Link>
        <Link to="urban" smooth={true} duration={500}>Urban</Link>
      </div>

      <div className="page-container">
        <div className="page" id="home">
          <h1>Home Page</h1>
          {/* Add content for Home Page */}
        </div>
        <div className="page" id="forest">
          <h1>Forest Page</h1>
          {/* Add content for Forest Page */}
        </div>
        <div className="page" id="beach">
          <h1>Beach Page</h1>
          {/* Add content for Beach Page */}
        </div>
        <div className="page" id="urban">
          <h1>Urban Page</h1>
          {/* Add content for Urban Page */}
        </div>
      </div>
    </div>
  );
}

export default App;
